type MsgIndex = Weak<DynamicIndex>; #[derive(Debug)]
enum AppMsg { AddFirst, RemoveLast, CountAt(MsgIndex), RemoveAt(MsgIndex), InsertBefore(MsgIndex), InsertAfter(MsgIndex),
