A worker is implemented similar to a component. One difference is that you use () as a placeholder for the Widgets type in the Model trait. Also, since you don't have widgets for the worker, you don't need to implement the Widgets trait. impl Model for WorkerModel { type Msg = WorkerMsg; type Widgets = (); type Components = ();
