Our message handler needs to store our sender and also the tokio runtime we use to process our messages (to keep the runtime alive). And of course, we need a message type as well. struct AsyncHandler { _rt: Runtime, sender: TokioSender<AsyncHandlerMsg>,
} #[derive(Debug)]
enum AsyncHandlerMsg { DelayedIncrement, DelayedDecrement,
} Then we need to implement the MessageHandler trait for our message handler. impl MessageHandler<AppModel> for AsyncHandler { type Msg = AsyncHandlerMsg; type Sender = TokioSender<AsyncHandlerMsg>; fn init(_parent_model: &AppModel, parent_sender: Sender<AppMsg>) -> Self { let (sender, mut rx) = channel::<AsyncHandlerMsg>(10); let rt = Builder::new_multi_thread() .worker_threads(8) .enable_time() .build() .unwrap(); rt.spawn(async move { while let Some(msg) = rx.recv().await { let parent_sender = parent_sender.clone(); tokio::spawn(async move { tokio::time::sleep(std::time::Duration::from_secs(1)).await; match msg { AsyncHandlerMsg::DelayedIncrement => { send!(parent_sender, AppMsg::Increment); } AsyncHandlerMsg::DelayedDecrement => { send!(parent_sender, AppMsg::Decrement); } } }); } }); AsyncHandler { _rt: rt, sender } } fn send(&self, msg: Self::Msg) { self.sender.blocking_send(msg).unwrap(); } fn sender(&self) -> Self::Sender { self.sender.clone() }
} First we define the message type. Then we specify the sender type. You could, for example, use std::sync::mpsc::Sender, tokio::sync::mpsc::Sender or any other sender type you want. The init function simply initializes the message handler. In the first part, we create a new tokio runtime that will process our messages. Then we check for messages in a loop. while let Some(msg) = rx.recv().await { When using components and workers, this loop runs in the background. Here we need to define it ourselves. The important part here is the await. Because we wait for new messages here, the tokio runtime can process our messages in the meantime. Therefore, we can handle a lot of messages at the same time. If you want to learn more about async in Rust, you can find more information here . Inside the loop, we process the message by waiting one second and then sending a message back to the parent component. The send method defines a convenient interface for sending messages to this message handler and the sender method provides a sender to connect events later.

