You might remember this section of code from the example application in the components chapter. impl Components<AppModel> for AppComponents { fn init_components( parent_model: &AppModel, parent_widgets: &AppWidgets, parent_sender: Sender<AppMsg>, ) -> Self { AppComponents { header: RelmComponent::new(parent_model, parent_widgets, parent_sender.clone()), dialog: RelmComponent::new(parent_model, parent_widgets, parent_sender), } }
} In order to run the dialog component on a new thread, we just need to change one line: impl Components<AppModel> for AppComponents { fn init_components( parent_model: &AppModel, parent_widgets: &AppWidgets, parent_sender: Sender<AppMsg>, ) -> Self { AppComponents { header: RelmComponent::new(parent_model, parent_widgets, parent_sender.clone()), dialog: RelmComponent::with_new_thread(parent_model, parent_widgets, parent_sender), } }
} Instead of RelmComponent::new we used RelmComponent::with_new_thread. The same is true for workers. RelmWorker::new runs the worker on the same thread and RelmWorker::with_new_thread spawns a new thread for the worker. Components have widgets that, in the case of GTK4, neither implement Send nor Sync. That means we can't run the view function from a different thread, but only the update function that just operates on the model. Internally, Relm4 sends the model from a new thread that handles the update function to the main thread that then handles the view function and back to the new thread again. This is not optimal regarding performance and therefore only recommended if you don't send a lot of messages to the component. Alternatively, you can always do the heavy work in a worker or a message handler because they don't have this problem.
